use conveniomysql;

select 'Dropando tabela de Municípios' AS '';

DROP TABLE IF EXISTS MUNICIPIOS;

select 'Criando tabela de Municípios' AS '';

CREATE TABLE MUNICIPIOS (
   CODIGO int(4) NOT NULL ,
   NOME varchar(40) NOT NULL,
   UF char(2) NOT NULL , 
   LATITUDE FLOAT (6,2) NOT NULL,
   LONGITUDE FLOAT (6,2) NOT NULL );

select 'Populando tabela de Municípios' AS '';

SET autocommit = 0;


commit;
set autocommit = 1;


Create Index MUNICIP1 ON MUNICIPIOS ( CODIGO );
Create Index MUNICIP2 ON MUNICIPIOS ( UF,NOME );
